import React, {useState} from 'react';
import classes from "./NineIteration.module.css";

export default () => {
    const [counterState, setCounter] = useState([]);
    console.log(counterState);
    return (
        <div className={classes.NineIteration}>
            <h1>Счётчик: {counterState}</h1>
            <button>Вверх</button>
            <button>Вниз</button>
        </div>
    )
}
